import React from 'react';
import Header from './components/Header';
import HomeBanner from './components/HomeBanner';
import Login from './components/Login';
import List from './components/List';
import Banner from './components/Banner';
import Overview from './components/Overview';
import { BrowserRouter as Router, Routes,Route } from 'react-router-dom';
import './App.css'
function App() {
  return (

    <React.Fragment>
      <Router>
        <Routes>
        <Route path='/' element={<React.Fragment>
          <Header name={"Sign-In"}></Header>
          <HomeBanner></HomeBanner>
        </React.Fragment>}></Route>

        <Route path='/login' element={<React.Fragment>
          <Header name={"Sign-In"}></Header>
          <Login page="log-in"> </Login>
        </React.Fragment>}></Route>

        <Route path='/register' element={<React.Fragment>
          <Header name={"Sign-In"}></Header>
         <Login page="register"></Login>
        </React.Fragment>}></Route>



        <Route path='/dashboard' element={ 
          <React.Fragment>
            <Header></Header>
            <Banner title="Netflix Originals" param="originals"></Banner>
          <List></List>
          </React.Fragment>

         }></Route>
         <Route  path="/login/dashboard" element={
            <React.Fragment>
              <Header name={"Sign-Out"}/>
              <Banner title="Netflix Originals" param="originals"/>
              {/* <List title="Netflix Originals" param="originals"/>
              <List title="Trending Now" param="trending"/>
              <List title="Now Playing" param="now_playing"/>
              <List title="popular" param="popular"/>
              <List title="Top Rated" param="top_rated"/> */}
              <List title="Upcoming" param="upcoming"/>
            </React.Fragment>
          }/>
          <Route path='/overview' element={ 
          <React.Fragment>
            <Header name={"Sign-Out"}></Header>
            <Overview></Overview>
          </React.Fragment>
          }/>
        </Routes>
      </Router>
    </React.Fragment>
    // <div className="App">
    //   <Header></Header>
    //   <HomeBanner></HomeBanner>
    // </div>
  );
}

export default App;
